create table goods_visit
(
    goods_id   int not null comment '商品ID',
    user_id    int not null comment '会员ID',
    visit_time int not null comment '浏览时间',
    cat_id1    int not null comment '商品一级分类',
    cat_id2    int not null comment '商品二级分类',
    cat_id3    int not null comment '商品三级分类',
    visit_id   int auto_increment comment '自增ID',
    primary key (goods_id, user_id, visit_id)
)
    comment '商品浏览历史表' charset = utf8;

create index goods_id
    on goods_visit (goods_id);

create index user_id
    on goods_visit (user_id);

create index visit_id
    on goods_visit (visit_id);

